    render() {
        const {pokemon} = this.props;

        <div>
            <Pokemon 
            name={pokemon.name} 
            type={pokemon.type} 
            averageWeight={pokemon.averageWeight}
            image={pokemon.image}
    />)
        </div> 

    return
    }
}
